  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is the results of a laboratory
  experiment.  Juvenile red king crab and Tanner crab were reared in individual containers
  for nearly 200 days in flowing control (pH 8.0), pH 7.8, and pH 7.5 seawater at
  ambient temperatures (range 4.4-11.9 C).  Survival, growth, and morphology were
  measured throughout the experiment.  At the end of the experiment, calcium concentration
  was measured in each crab and the dry mass and condition index of each crab were
  determined.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
